import React, {Component} from 'react';
import {useSpring, animated} from 'react-spring'
import './MangaPanel.css';
import {animationConfig} from './constants.js'

const props = useSpring({opacity: 1, from: {opacity: 0}});

function MangaPanel(props)  {
  return (
    <animated.div key={props.pageConfig} className="MangaPanel">
      <img src={props.pageConfig.img} draggable="false" unselectable="on"></img>
    </animated.div>
  );
}

export default MangaPanel;
